    <style>
      body,
      html {
        margin: 0;
        width: 100%;
        height: 100%;
        overflow: hidden;
      }
      .bg-color {
        background-color: #ffffff;
      }
      @media (prefers-color-scheme: dark) {
        .bg-color {
          background-color: #292f36;
        }
      }
      .shadow-sm {
        margin: 0;
        padding: 0;
        box-shadow: 0 1px 2px 0 rgba(0, 0, 0, 0.05);
      }
      @keyframes fade-in {
        0% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      .show-after-init {
        visibility: hidden;
        animation: fade-in 1s ease-out;
      }
      .flex {
        display: flex;
      }
      .flex.flex-row {
        flex-direction: row;
      }
      .flex.items-center {
        align-items: center;
      }
      .flex.justify-center {
        justify-content: center;
      }
      .bezel {
        background-color: #dfe6eb;
      }
      @media (prefers-color-scheme: dark) {
        .bezel {
          background-color: #1e2229;
        }
      }
      .bezel-classic {
        background: linear-gradient(
          45deg,
          #000000 45%,
          #2e2e2e 47%,
          #000000 55%
        );
      }
      .rounded-lg {
        border-radius: 0.5rem;
      }
      .rounded-full {
        border-radius: 9999px;
      }
      .ring {
        outline: solid 1px #aeb4b7;
      }
      @media (prefers-color-scheme: dark) {
        .ring {
          outline: solid 1px #46505c;
        }
      }
      canvas {
        padding: 2rem;
        animation: fade-in 0.3s linear;
        display: block;
      }
      .fit {
        @media screen and (max-width: calc(800px + 5rem)) {
          padding: 2rem;
          width: calc(100dvw - 5rem);
          height: calc((100dvw - 5rem) * (100dvw / 100dvh));
        }
        @media screen and (max-height: calc(480px + 5rem)) {
          padding: 2rem;
          width: calc((100dvh - 5rem) * (100dvw / 100dvh));
          height: calc(100dvh - 5rem);
        }
      }
    </style>

/** @param {string|number=} what */
function abort(what) {
  if (Module['onAbort']) {
    Module['onAbort'](what);
  }

  what = 'Aborted(' + what + ')';
  // TODO(sbc): Should we remove printing and leave it up to whoever
  // catches the exception?
  err(what);

  ABORT = true;
  EXITSTATUS = 1;

  what += '. Build with -sASSERTIONS for more info.';

  // Use a wasm runtime error, because a JS error might be seen as a foreign
  // exception, which means we'd run destructors on it. We need the error to
  // simply make the program stop.
  // FIXME This approach does not work in Wasm EH because it currently does not assume
  // all RuntimeErrors are from traps; it decides whether a RuntimeError is from
  // a trap or not based on a hidden field within the object. So at the moment
  // we don't have a way of throwing a wasm trap from JS. TODO Make a JS API that
  // allows this in the wasm spec.

  // Suppress closure compiler warning here. Closure compiler's builtin extern
  // defintion for WebAssembly.RuntimeError claims it takes no arguments even
  // though it can.
  // TODO(https://github.com/google/closure-compiler/pull/3913): Remove if/when upstream closure gets fixed.
  /** @suppress {checkTypes} */
  var e = new WebAssembly.RuntimeError(what);

  // Throw the error whether or not MODULARIZE is set because abort is used
  // in code paths apart from instantiation where an exception is expected
  // to be thrown when abort is called.
  throw e;
}
